Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('1','M','injetora com servibombas','Equipadas com o moderno sistema “Stop and Go” que proporciona maior velocidade, alta precisão e baixo consumo de energia. ');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('2','M','Injetoras Eletrica','Injetoras Elétricas de alta performance especialmente desenvolvidas para ciclos rápidos e peças de paredes finas, destacam-se pela alta velocidade e precisão com elevada eficiência energética. ');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('3','M','Injetora Hibrida','A injetora híbrida ROMI ES 300 foi desenvolvida para a produção de peças plásticas que exijam alta razão de injeção, máxima precisão e ciclos ultrarrápidos com o menor consumo de energia. ');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('4','M','Injetora Dupla Placa','Injetoras de Plástico BOLE Dupla Placa Série DK sistema patenteado de travamento das colunas as quais são forjadas em peça única, placa móvel apoiada por guias lineares, maior curso de abertura e placas retangulares (wide size) que possibilita moldes maiores em máquinas menores. Sistema de plastificação projetado na Alemanha e design exclusivo da estrutura do cilindro de injeção.');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('5','M','Injecao de termoplastico','Máquina Injetora de Plástico');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('6','M','Extrusora de filme','Fabricado em aços especiais, possui anel de resfriamento com dupla saída de ar , cujo perfeito sopro permite a extrusão de filmes com qualidade em brilho e espessura, nos diversos tipos de materiais, como baixa densidade(PEBD), linear (PEBDL) e alta densidade (PEAD).');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('7','M','EMPACOTADORAS','Destinada a produção de pacotes prontos com medidas de até 250 mm. O equipamento apresenta vantagens de aplicação em condições de excesso de pó (do produto e/ou ambiente) ou embalagem muito fina, onde o tracionamento por correia de arraste não se mostre tão eficaz.
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('8','M','Alta Frequência para Brinquedo Inflável','Máquina projetada para soldar qualquer material a base de pvc em linha reta ou curva, entre outras vantagens possui uma distância maior entre o pistão e a coluna de fixação, proporcionando o acondicionamento de maior quantidade de material, facilitando a fabricação de produto com grande formato.');
Insert into T_JKC_CATEGORIA_MAQUINA (ID_CATEGORIA,TP_CATEGORIA_MAQUINA,NM_CATEGORIA,DS_COMPLETA_CATEGORIA_MAQ) values ('9','M','Aplainadora','A PM310 é uma máquina de fresar eficiente e altamente manobrável, com uma largura de corte de 1.000 mm (39,4 pol) que executa a remoção controlada e de profundidade total de pavimentos de asfalto e concreto em uma única passada.');
